import image3 from './media/adidas X PLR Red.jpg'


const Main = () => {
    return (
        <main class='main'>
            <div>
                <div>
                    <img src={image1} alt=""></img>
                    <div>Title</div>
                </div>
            </div>
        </main>
    )
}

export default Main
